(213, 13, 3, 'Bùa Trí Tuệ', 'Tiềm năng và sức mạnh của bạn sẽ nhận được gấp đôi trong 1 khoảng thời gian, kể từ lúc mua', 1403, -1, 0, 0),
(214, 13, 3, 'Bùa Mạnh Mẽ', 'Cú đấm của bạn sẽ mạnh hơn. Tăng 150% sức đánh hiện có khi bạn đánh Quái trong 1 khoảng thời gian, kể từ lúc mua', 1404, -1, 0, 0),
